import './App.css';
import Countdown from './Components/Countdown';
import logo from './images/landing.jpg'
function App() {
  return (
    <div className='App'>
      { Countdown() }

      <div className="logo-container">
        <img className="logo" src={logo} alt="PetsVille logo"/>
      </div>

    </div>
  );
}

export default App;
